import React, { Component } from "react";

export default class App extends Component {
  constructor(props) {
    super(props);

    this.state = {};
  }

  componentDidMount() {
    fetch("/").then(Response =>
      Response.json().then(() => {
        console.log(Response);
      })
    );
  }

  render() {
    return <div>test</div>;
  }
}
